import { Box, Container, Grid } from "@mui/material";

const Banner = () => {
    return (
        <Container>
            <Grid container>
                <Grid xs={12} md={6}>
                    <Box>
                        <img src="images/logo-sst-colores.png" alt="" width={300}/>

                    </Box>
                </Grid>
            </Grid>
        </Container>
    );
}

export default Banner;
